import React from 'react';
import { Link } from "react-router-dom";

const Heading = () => {
    return (
        <div
        style={{
            display: "flex",
            flexDirection: "column",
            alignItems: "center",
            width: "100%",
        }}>
            <h1>
                Hello, React!
                <Link to='/'>home</Link>
                <Link to='/upload'>upload</Link>
                <Link to='/list'>list</Link>

            </h1>
        </div>
    );
};

export default Heading;
